import React from "react";
import Auth from "./Auth";
import Home from "./Home";
import { Route, Link } from "react-router-dom"


function IsAuth({children}){
    // const auth = use
    return (
        {children}
    )

}

function App() {

    return (
        <div className="app">
            <IsAuth>
                <Route exact path="/" component={Home}/>
                <Route exact path="/auth" component={Auth}/>
            </IsAuth>
        </div>
    );
}

export default App;
